import * as React from 'react';
import styled from '@mui/system/styled';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import HomeIcon from '@mui/icons-material/Home';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import MoreIcon from '@mui/icons-material/MoreVert';

const StyledAppBar = styled(AppBar)({
  top: 'auto',
  bottom: 0,
  background: '#344955',
  boxShadow: 'none',
  borderTop: '1px solid #ccc',
  overflow: 'visible', // Permitir que los elementos se extiendan fuera del contenedor
});

const CenteredBox = styled('div')({
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
  width: '100%',
  padding: '0 16px', // Ajusta según sea necesario
});

const CircularIconButton = styled(IconButton)({
  borderRadius: '50%',
  backgroundColor: '#ecf3f3',
  '&:hover': {
    backgroundColor: '#b0c4c4',
  },
  marginLeft: '-16px', // Margen negativo para hacer que el botón sobresalga
  zIndex: 1, // Asegura que el botón esté sobre el fondo
});

export default function BottomAppBar() {
  return (
    <StyledAppBar position="fixed">
      <Toolbar>
        <CenteredBox>
          <IconButton size="large" edge="start" color="#ecf3f3" aria-label="open drawer">
            <MoreIcon />
          </IconButton>
          <CircularIconButton size="large" color="#ecf3f3" aria-label="home">
            <HomeIcon />
          </CircularIconButton>
          <IconButton size="large" edge="end" color="#ecf3f3" aria-label="account">
            <AccountCircleIcon />
          </IconButton>
        </CenteredBox>
      </Toolbar>
    </StyledAppBar>
  );
}
